import React from 'react';
import './App.css';
import Header from './components/header/header';
import Body from './components/body/body';
import Footer from './components/footer/footer';
function App() {
  return (
      <div>
        <Header></Header>
        <Body></Body>
        <Footer></Footer>
      </div>
  );
}
export default App;
